import React from 'react';
import './styles.css';

const Footer = () => (
  <footer className="footer">
    <div className="footer-container">
      <div className="footer-left">
        <h1>esquerda</h1>
      </div>

      <div className="footer-right">
        <h1>direita</h1>
      </div>
    </div>
  </footer>
);

export default Footer;
